import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    spartans: []
  }

  componentDidMount() {
    fetch('/spartans')
      .then(res => res.json())
      .then(spartans => this.setState({spartans}));
  }

  render(){
    return (
      <div className="App">


            <h1> UNSC CLASSIFIED INFORMATION</h1>




          <h1>Spartans</h1>
          { this.state.spartans.map(spartans =>
            <li key={spartans._id}>{spartans.name}</li>
          )}


      </div>
    );
  }

}

export default App;
